import { useEffect, useState } from "react";
import { createDineInOrder, getOrderById } from "../../api/orderApi";

function OrderCreateDineIn() {
  const [waiterId, setWaiterId] = useState("");
  const [tableNo, setTableNo] = useState("");
  const [courseName, setCourseName] = useState("");
  const [quantity, setQuantity] = useState(1);
  const [courses, setCourses] = useState({});
  const [dineInOrders, setDineInOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  /* ---------------- ADD COURSE ---------------- */
  const addCourse = () => {
    if (!courseName) return;

    setCourses(prev => ({
      ...prev,
      [courseName]: Number(quantity)
    }));
    setCourseName("");
    setQuantity(1);
  };

  /* ---------------- CREATE ORDER ---------------- */
  const submit = async () => {
    const orderId = await createDineInOrder(
      Number(waiterId),
      Number(tableNo),
      courses
    );

    alert("Order created: " + orderId);

    setCourses({});
    loadDineInOrders(); // ðŸ”¥ otomatik refresh
  };

  /* ---------------- LOAD DINE-IN ORDERS ---------------- */
  const loadDineInOrders = async () => {
    setLoading(true);
    const results = [];
    let id = 1;

    while (true) {
      try {
        const order = await getOrderById(id);
        if (order && order.tableNo) {
          results.push(order);
        }
        id++;
      } catch (err) {
        break; // 404 â†’ stop
      }
    }

    setDineInOrders(results);
    setLoading(false);
  };

  useEffect(() => {
    loadDineInOrders();
  }, []);

  /* ---------------- UI ---------------- */
  return (
    <div>
      <h2>Create Dine-In Order</h2>

      <input
        placeholder="Waiter ID"
        value={waiterId}
        onChange={e => setWaiterId(e.target.value)}
      /><br /><br />

      <input
        placeholder="Table No"
        value={tableNo}
        onChange={e => setTableNo(e.target.value)}
      /><br /><br />

      <h4>Add Course</h4>

      <input
        placeholder="Course Name"
        value={courseName}
        onChange={e => setCourseName(e.target.value)}
      />

      <input
        type="number"
        min="1"
        value={quantity}
        onChange={e => setQuantity(e.target.value)}
      />

      <button onClick={addCourse}>Add</button>

      <pre>{JSON.stringify(courses, null, 2)}</pre>

      <button onClick={submit}>Create Order</button>

      <hr />

      <h3>Dine-In Orders</h3>

      {loading && <p>Loading...</p>}

      {!loading && dineInOrders.length === 0 && (
        <p>No dine-in orders.</p>
      )}

      {dineInOrders.length > 0 && (
        <table border="1" cellPadding="8">
          <thead>
            <tr>
              <th>Order ID</th>
              <th>Table No</th>
              <th>Status</th>
              <th>Price</th>
              <th>Date</th>
              <th>Time</th>
              <th>Waiter</th>
            </tr>
          </thead>
          <tbody>
            {dineInOrders.map(o => (
              <tr key={o.orderId}>
                <td>{o.orderId}</td>
                <td>{o.tableNo}</td>
                <td>{o.status}</td>
                <td>{o.orderPrice} â‚º</td>
                <td>{o.date}</td>
                <td>{o.time}</td>
                <td>{o.delivererId}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default OrderCreateDineIn;
